var _story_ = {
    "1409": [
        {
            "_id": 1,
            "Story": "As the city-state in the clouds crumbles through time, the Twilight Courtyard opens its gates once more, bringing a glimmer of light to Evernight.<br>You, Physician Hyacinthia, Chrysos Heir who guards the Sky Coreflame, must inherit your ancestors' will and mend the torn fabric of dusk and dawn.<br>May the rainbow light pour down, dissolve all grudges, and bring the dawn back to this land."
        },
        {
            "_id": 2,
            "Story": "<i>\"Slowly spread your wings... yes, just like we did last time. Breathe deeply together with the doctor, okay?\"<br>\"Relax a little. It's all fine... hmm, your wingspan has grown! You've been eating well, haven't you?\"</i><br>The candlelight cast a warm glow on the fluffy little head as the girl picked up the pony and gently placed it on the scale.<br><br><i>\"Don't worry. Soon you'll be just as tall and strong as the other winged beasts, okay?\"</i><br>Putting on the stethoscope, the girl began her examination. As she touched the pony's side, she felt a new \"wound\" beneath its ribs.<br><i>\"You're hurt?\"</i><br><br>She gently stroked the pony's wings, carefully stuffing cotton into the loosened crack before taking out a needle and thread.<br><i>\"It'll hurt a little, but don't worry, my stitches are steady...\"<br>\"You've been training too hard again, haven't you? Because so many people keep telling you about your mother, your grandmother, and all the great ancestors? How they could soar into the sky with a single leap, and how they could shatter rock with a single charge?\"<br>\"Everyone expects you to become a hero like thunder itself, but no matter how much you train, it feels like you only let them down...\"<br>\"Like you're completely different from them...\"</i><br><br>The pony remained still, its dark, glossy eyes gazing out the window.<br>The thunder that tore through the sky still echoed in the distance, a storm stirred by the heroes of the sky city and their winged beasts.<br><i>\"Let me tell you a secret... I'm just like you...\"</i><br><br>In that lonely, dimly lit ward, the girl, bedridden for so long, clutched her doll and needle, practising for the hundredth time the medical techniques her father had taught her.<br><br><i>\"But maybe... a different kind of light has its own meaning too...\"</i>"
        },
        {
            "_id": 3,
            "Story": "Like all healers, the girl made a vow to cure everyone.<br>She wished to soothe the suffering of mortals as the world collapsed, but when the black tide swallowed city-states and plague surrounded the wounded, she could only drive away disease  she could not stop despair from spreading.<br><i>\"Perhaps, to be a good physician, one needs far more than just effective medicine...\"</i><br><br><i>\"Milky-white curtains should let in the light, the bed should be firm yet soft, and fresh flowers should be placed by the bedside... that way, even inside the room, they can see the same 'colors' as outside...\"</i><br>She wanted to bring hope to those in the final days, a ray of light shining in from the future.<br><br>Accompanied by the soothing scent of incense, a girl on the verge of passing murmured in the warmth and comfort of the room, as long-sealed memories slowly resurfaced.<br><i>\"The day my father gave me a music box, it was also drizzling outside. I listened to the chimes of its melody, spending the most wonderful birthday amidst the pitter-patter of the rain...<br>\"I still remember how white roses bloomed all along the streets, and when the wind blew, it was like a snowfall filled with fragrance...<br>\"And that sky, a deepening blue with a touch of orange-red falling within it,\"</i> she reminisced, <i>\"and then those transparent bubbles surrounded me, just like...<br>just like they are now...\"</i><br><br>Tick-tock, tick-tock...<br>The clock hands moved through memories as the voice telling them grew weaker.<br>In the ever-flowing sound of rain, only a single sigh of content remained.<br><br><i>\"Du du...\"</i>Little Ica lowered its head, dejectedly curling up beside the plush pony.<br><i>\"Little Ica, did you hear that... She saw the sky we created...\"</i><br>On the ceiling of the room, the setting sun sank into the sea.<br><br>She held the girl's gradually cooling hand, crystal-clear tears slipping down her face.<br><i>\"One day, we'll make it even wider, even warmer...\"<br>\"Du!\"</i>"
        },
        {
            "_id": 4,
            "Story": "Okhema, the gathering place of heroes, the last hope in the end times.<br>\"The Flame-Chase Journey,\" \"The Coreflame,\" \"The Titans\"... Even though she had long grown familiar with these fierce and burning names, when others called her a hero, she would simply wave it off.<br><i>\"I'm just a physician.\"</i><br>That was what she told everyone who came to the courtyard.<br><br>The sorrowful girl came seeking answers about the \"incurable ailment\" inflicted by the Death Titan.<br><i>\"Cassie, that's not an illness at all! There's still so much for you to experience!\"</i><br>She often accompanied the girl in birdwatching and stargazing, crafting specimens and chimera plush toys. Seeing the smile on the girl's face, she, too, felt warmth.<br><br>She was well aware of the discord between the cold weaver and the proud scholar.<br>In the newly established mediation room, she prepared the weaver's favorite oatmeal, the scholar's essential fizzy horseradish vinegar for grading papers, and invited the eldest demigod.<br><i>\"If they refuse to come, then... I'll have Little Ica du-du-du in their ears every single day!\"</i><br><br>She sowed pomegranate seeds in the Twilight Courtyard, planted a field of wheatgrass, and cultivated a sea of flowers, creating a place where every traveler arriving in Okhema could set down their burdens and speak freely.<br><i>\"I hope that small acts of kindness can melt away the long-standing wounds between our peoples.\"</i><br><br>She could never stop worrying about that ever-corroding demigod.<br><i>\"Cinny... From the very first day <b>we</b> set out on the Flame-Chase Journey, <b>we</b> already knew this day would come...\"</i><br>That was what they always said.<br><i> \"Even if I can ease just a fraction of your pain... I'll go check the library in the Grove again...\"</i><br>And that was what she always did.<br>...<br><br>The Heirs of the Sky, the Kremnoans, the original aristocrats of Okhema, the Holy Maiden of Aidonia, the warrior of Aedes Elysiae, the Holy Maiden of Janusopolis... In the small courtyard, all their colors merged into a radiant rainbow.<br>Yet in rare moments of leisure, she would also ponder the journey's end.<br><i>\"When that time comes... what else will I be able to do?\"</i>"
        },
        {
            "_id": 5,
            "Story": "<i>\"'Light Calendar , Month of Fortune' To Physician Hyacine<br>I hope this letter finds you well. Although my sister couldn't make it back then, the last days she spent in the courtyard... and the smile she gave before she left... have always warmed my dreams. I wanted to tell you that today, I have officially become a physician. I want to be like you, to help those who suffer in the final days. I hope that in this long night, I too can become a small, guiding light...\"<br><br>\"'Light Calendar , Month of Gate' To Little Cinny<br>...I'm truly grateful for your companionship during this time. When I was curled up in the Twilight Courtyard's infirmary, you allowed my sorrow to pile up like storm clouds and then evaporate. When I said my 'weather was bad,' you embraced me completely... Perhaps, I should try to be a little braver too...\"<br><br>\"'Light Calendar , Month of Freedom' To Lady Hyacine<br>The little ones have all recovered well, especially that young Okheman warrior who was fussing about wanting pomegranate juice last time. The feuds between city-states are not easy to dissolve quickly, but now I believe that different colors can coexist.\"<br><br>\"'Light Calendar , Month of Evernight' To Assistant Instructor Hyacine<br>Thank you for your persistent reminders. I will consider mending my relationship with her. Of course, this is only for your sake...\"<br><br>\"'Light Calendar , Month of Mourning' To Miss Hyacine<br>There is no need to trouble yourself by sending me new medicine. I am well aware that the loss of my humanity is beyond recovery. And you need not worry, our relationship with the Grove has not reached a breaking point...\"<br><br>\"'Light Calendar , Month of Joy' To Lady Hyacine<br>I never thought that the wheat seeds from my homeland would sprout again one day. Lying in the garden of the Twilight Courtyard, it almost feels like being back in Aedes Elysiae. Whenever I feel down, the scent of wheat here gives me the strength to keep going!\"<br><br>\"'Light Calendar , Month of Everday' To Cinny<br>People always praise the sky of the past for embracing both blazing suns and roaring thunder, but <b>we</b> think you are even gentler than that sky. No matter where <b>we</b> go tomorrow, <b>we</b> will always, always remember you!\"</i><br><br>A few letters spilling out from an overflowing box were carefully preserved beside the medical records.<br>At the beginning of her journey, the girl's faint light seemed as though it would be swallowed by the darkness at any moment. Yet, before she set forth to become the sky of tomorrow...<br><br>In the places she passed through, the clear sky had already unknowingly unfolded its first gentle smile."
        }
    ]
}

